script: |
  super -f text -I q12568.spq | sort > q12568.out

inputs:
  - name: q12568.spq
    data: |
      SELECT ALL - CAST ( NULL AS INTEGER ) * 92 AS col0, ( + col1 ) * + 77 + - 49 * + col0 * + + 65 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN ( col0 ) AND - 57 / - col1 + - - col2;
  - name: tab1

outputs:
  - name: q12568.out
    data: |
